import './App.css';
import Footer from './components/footer/Footer';
import Header from './components/header/Header';
import { Page1 } from './sections/page1/Page1';
import {Page2} from '.'

function App() {
  return (
    <div className="App">
      <Header />
      <section className='sections'>
        <Page1 />
        <Page2 />
        <Page3 />
        <Page4 />
        <Page5 />
      </section>
      <Footer />
    </div>
  );
}

export default App;
